const Form = () => {
	return (

	<div>
		<h1>Get in Touch</h1>
		<p>Please fill out the quick form and we will be in touch with lightening speed.</p>
		<label for="email">Email</label>
		<input type="email" className="Email" name="email" placeholder="Your Email address" /><br/>
		<label for="feedback">Message</label>
		<input type="textarea" claccName="Message" placeholder="Message" rows="8" cols="40" maxLength="200"/> <br />
		<input type="submit" className="Button"/>
	</div>

		)
}

export default Form;
